import React from 'react';
import { Link } from "react-router-dom";
import './Header.css';

export function Header(){
    return (
        <div>
            <div className="logo">
                velopert
            </div>
            <div className="menu">
                <li>홈</li>
                <li>알라딘</li>
                <li>라이언킹</li>
                <li>스파이더맨</li>
            </div>
        </div>
    );
};

export default Header;
